import React, { Component } from "react";
import "./Tile.css";

class Tile extends Component {
  state = {};
  render() {
    return (
      <div className=".tile-container">
        {this.props.icon}
        {this.props.title}
        {this.props.description}
        {this.props.link}
      </div>
    );
  }
}

export default Tile;
